import Axios from 'axios';
import React from 'react';
import './App.css';

function App() {
  let room = []

  Axios.get("https://localhost:8080/chat/rooms")
  .then(response=>{
    room : response.data
  })

  return (
    <div className="App">
        <div>{room}</div>
    </div>
  );
}

export default App;
